CREATE TABLE ORDEM_PECAS (
	NR_OS                INTEGER NOT NULL ,
	CD_PECA              INTEGER NOT NULL ,
	QT_PECA              NUMERIC(3) NULL ,
	VL_UNIT_PECA         NUMERIC(8,3) NOT NULL);

ALTER TABLE ORDEM_PECAS
	ADD CONSTRAINT  XPKORDEM_PECAS PRIMARY KEY (NR_OS,CD_PECA);

CREATE TABLE ORDEM_SERVICO(
	NR_OS                INTEGER NOT NULL ,
	DT_ABERTURA          DATE NOT NULL ,
	NR_PLACA             VARCHAR(7) NOT NULL ,
	CD_PROP              INTEGER NOT NULL ,
	VL_TOTAL             NUMERIC(8,3) NULL ,
	DT_ENCERRAMENTO      DATE NULL);

ALTER TABLE ORDEM_SERVICO
	ADD CONSTRAINT  XPKORDEM_SERVICO PRIMARY KEY (NR_OS);

CREATE TABLE PECAS(
	CD_PECA              INTEGER NOT NULL ,
	DS_PECA              VARCHAR(60) NOT NULL ,
	VL_COMPRA            NUMERIC(8,3) NOT NULL ,
	VL_VENDA             NUMERIC(8,3) NOT NULL ,
	QT_ESTOQUE           NUMERIC(3) NOT NULL);

ALTER TABLE PECAS
	ADD CONSTRAINT  XPKPECAS PRIMARY KEY (CD_PECA);

CREATE TABLE PROPRIETARIO(
	CD_PROP              INTEGER NOT NULL ,
	NM_PROP              VARCHAR(80) NOT NULL ,
	DS_ENDERECO          VARCHAR(60) NOT NULL ,
	NR_ENDERECO          VARCHAR(8) NULL ,
	DT_NASCIMENTO        DATE NULL ,
	NR_TELEFONE          VARCHAR(10) NULL ,
	DS_EMAIL             VARCHAR(20) NULL);

ALTER TABLE PROPRIETARIO
	ADD CONSTRAINT  XPKPROPRIETARIO PRIMARY KEY (CD_PROP);

CREATE TABLE SERVICO(
	CD_SERVICO           INTEGER NOT NULL ,
	DS_SERVICO           VARCHAR(60) NOT NULL ,
	VL_HORA              NUMERIC(8,3) NOT NULL);

ALTER TABLE SERVICO
	ADD CONSTRAINT  XPKSERVICO PRIMARY KEY (CD_SERVICO);

CREATE TABLE SERVICOS_EXECUTADOS(
	NR_OS                INTEGER NOT NULL ,
	CD_SERVICO           INTEGER NOT NULL ,
	NR_HORAS             NUMERIC(8,3) NOT NULL);

ALTER TABLE SERVICOS_EXECUTADOS
	ADD CONSTRAINT  XPKSERVICOS_EXECUTADOS PRIMARY KEY (NR_OS,CD_SERVICO);

CREATE TABLE VEICULO(
	NR_PLACA             VARCHAR(7) NOT NULL ,
	DS_MARCA             VARCHAR(30) NOT NULL ,
	DS_MODELO            VARCHAR(30) NOT NULL ,
	DS_COR               VARCHAR(15) NOT NULL);

ALTER TABLE VEICULO
	ADD CONSTRAINT  XPKVEICULO PRIMARY KEY (NR_PLACA);

CREATE TABLE VEICULO_PROP(
	NR_PLACA             VARCHAR(7) NOT NULL ,
	CD_PROP              INTEGER NOT NULL);

ALTER TABLE VEICULO_PROP
	ADD CONSTRAINT  XPKVEICULO_PROP PRIMARY KEY (NR_PLACA,CD_PROP);

ALTER TABLE ORDEM_PECAS
	ADD CONSTRAINT FK_OS_OSPECAS FOREIGN KEY (NR_OS) REFERENCES ORDEM_SERVICO (NR_OS);

ALTER TABLE ORDEM_PECAS
	ADD CONSTRAINT FK_PECAS_OSPECAS FOREIGN KEY (CD_PECA) REFERENCES PECAS (CD_PECA);

ALTER TABLE ORDEM_SERVICO
	ADD CONSTRAINT FK_VP_OS FOREIGN KEY (NR_PLACA, CD_PROP) REFERENCES VEICULO_PROP (NR_PLACA, CD_PROP);

ALTER TABLE SERVICOS_EXECUTADOS
	ADD CONSTRAINT FK_OS_OSSERVICOS FOREIGN KEY (NR_OS) REFERENCES ORDEM_SERVICO (NR_OS);

ALTER TABLE SERVICOS_EXECUTADOS
	ADD CONSTRAINT FK_SERVICOS_SERVICOSEXE FOREIGN KEY (CD_SERVICO) REFERENCES SERVICO (CD_SERVICO);

ALTER TABLE VEICULO_PROP
	ADD CONSTRAINT FK_VEICULO_VP FOREIGN KEY (NR_PLACA) REFERENCES VEICULO (NR_PLACA);

ALTER TABLE VEICULO_PROP
	ADD CONSTRAINT FK_PROPRIETARIO_VP FOREIGN KEY (CD_PROP) REFERENCES PROPRIETARIO (CD_PROP);


